import React, { useState } from 'react';
import axios from 'axios';
import './Api.css';

function Api() {

    const [apidata,setApidata]=useState([]);


    const fetchApi=()=>{
        axios.get(`https://fakestoreapi.com/products`)
        .then((response)=>{
            console.log(response);

            setApidata(response.data)
        })
    }
  return (
    <>

       {/* <button className='button' onClick={fetchApi}>Click me</button> */}

       {
        apidata.map((data)=>{
          return(
            <>
            <div className='products'>
               <div className='cards'>
               {/* <p>{data.id}</p> */}
               <p>{data.title}</p>
               <p>{data.price}</p>
               <p>{data.albumId}</p>
               <img src={data.image} alt='image' className='images'></img>
               {/* <a href="https://fakestoreapi.com/products/1"><img src={data.image} className='images'></img></a> */}
               </div>
               </div>
            </>
          )
        })  
        }
    </>
  );

}

export default Api;
